// src/Pages/Home.jsx
import React from 'react';
import PageLayout from '../components/PageLayout';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const contentBoxes = [
    {
      title: 'Journey to Enlightenment',
      image: '/images/J2EBanner.jpg',
      link: '/Journey2Enlightenment',
    },
    {
      title: 'Sea Moss',
      image: '/images/SeaMossBanner.jpg',
      link: '/MAVJSeaMoss',
    },
    {
      title: 'Solar Lunar Castor Oil',
      image: '/images/CastorOilBanner.jpg',
      link: '/SolarLunarCastorOil',
    },
    {
      title: 'Vibrational Intelligence',
      image: '/images/VIBanner.jpg',
      link: '/VibrationalIntelligence',
    },
    {
      title: 'MAVJ Store',
      image: '/images/store-banner.jpg',
      link: '/MAVJStore',
    },
    {
      title: 'Search Engine',
      image: '/images/search-banner.jpg',
      link: '/search',
    },
  ];

  return (
    <PageLayout
      title="Welcome to My Alkaline Vegan Journey"
      subtitle="The official home for the Journey to Enlightenment"
      showHero={true}
      showGallery={true}
      showFooter={true}
    >
      <section className="paragraph-container text-white text-lg leading-relaxed p-6 bg-black bg-opacity-70 rounded-xl shadow-lg mb-10">
        <p>
          My Alkaline Vegan Journey (MAVJ) is the global platform for healing, herbalism, and frequency medicine. Discover transformative protocols, sacred nutrition, and bioelectric tools to realign your health and spirit. Join us as we reclaim ancestral knowledge and create a new future rooted in vibrational intelligence and aligned living.
        </p>
      </section>

      <section className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {contentBoxes.map((box, index) => (
          <div
            key={index}
            className="cursor-pointer group relative overflow-hidden rounded-2xl shadow-xl border-4 border-transparent hover:border-[#00ffae] transition duration-300 bg-black"
            onClick={() => navigate(box.link)}
          >
            <img
              src={box.image}
              alt={box.title}
              className="w-full h-48 object-cover opacity-80 group-hover:opacity-100 transition duration-300"
            />
            <div className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-60 group-hover:bg-opacity-40 transition duration-300">
              <h3 className="text-white text-xl font-bold text-center px-4">
                {box.title}
              </h3>
            </div>
          </div>
        ))}
      </section>
    </PageLayout>
  );
};

export default Home;
